import React, {useState, useEffect} from "react";
import axios from "axios";
import Product from "./UI/product/Product";

function DataFetching() {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8888/shop-sw/back-end/public/')
            .then(response => {
                setProducts(response.data)
            });
    });

    return (
        <div>
            <ul>
                {
                    // products.map(product => <li key={product.id}>{product.sku} {product.name} {product.price} {product.productType}</li>)
                    products.map(product => <li key={product.id}><Product sku={product.sku} name={product.name} price={product.price} productType={product.productType}/></li>)
                }
            </ul>
        </div>
    )
}

export default DataFetching
